a9dd15a6-e811-4eb2-95bd-183a4925524f	0	2024-10-15 09:07:16.104528	2024-10-15 09:07:16.104528	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:cdm_source	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	daf5ba8d-646f-44f3-ad5d-d3fcf8f8e16a	e8960c13-0df7-4de1-be68-bff917ab857e	2	admin@maurodatamapper.com	\N	cdm_source	**Table Description:** The CDM_SOURCE table contains detail about the source database and the process used to transform the data into the OMOP Common Data Model.
b3d9cce7-3666-4904-b0ee-bf5bbd5f8106	0	2024-10-15 09:07:16.105082	2024-10-15 09:07:16.105082	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:specimen	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	3cba8b78-2b8e-4f7e-89d0-cb08bcae2bdb	e8960c13-0df7-4de1-be68-bff917ab857e	33	admin@maurodatamapper.com	\N	specimen	**Table Description:** The specimen domain contains the records identifying biological samples from a person.\n\n\n\n**ETL Conventions:** Anatomic site is coded at the most specific level of granularity possible, such that higher level classifications can be derived using the Standardized Vocabularies.
3f2060a8-a03d-44e6-8815-1edef9911560	0	2024-10-15 09:07:16.104776	2024-10-15 09:07:16.104776	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:vocabulary	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	a23067b4-7ad6-4e58-8696-10e08bd14494	e8960c13-0df7-4de1-be68-bff917ab857e	36	admin@maurodatamapper.com	\N	vocabulary	**Table Description:** The VOCABULARY table includes a list of the Vocabularies collected from various sources or created de novo by the OMOP community. This reference table is populated with a single record for each Vocabulary source and includes a descriptive name and other associated attributes for the Vocabulary.
3ed975bb-faf8-457d-b6c2-b6091137dd93	0	2024-10-15 09:07:16.105515	2024-10-15 09:07:16.105515	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:concept_relationship	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	35f15c59-99b2-411f-865a-1824aa392821	e8960c13-0df7-4de1-be68-bff917ab857e	7	admin@maurodatamapper.com	\N	concept_relationship	**Table Description:** The CONCEPT_RELATIONSHIP table contains records that define direct relationships between any two Concepts and the nature or type of the relationship. Each type of a relationship is defined in the RELATIONSHIP table.
1ffcfdb7-5dc3-4f1f-b540-951bbc6b4d73	0	2024-10-15 09:07:16.105623	2024-10-15 09:07:16.105623	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:attribute_definition	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	f4c2c70a-804f-4475-a1b6-16e88eb6ae3e	e8960c13-0df7-4de1-be68-bff917ab857e	0	admin@maurodatamapper.com	\N	attribute_definition	\N
dc46dd04-9fcf-4174-b9bb-2a755267b145	0	2024-10-15 09:07:16.104824	2024-10-15 09:07:16.104824	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:payer_plan_period	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	4afb52db-c44d-43ff-b7fe-ec00682750c7	e8960c13-0df7-4de1-be68-bff917ab857e	27	admin@maurodatamapper.com	\N	payer_plan_period	**Table Description:** The PAYER_PLAN_PERIOD table captures details of the period of time that a Person is continuously enrolled under a specific health Plan benefit structure from a given Payer. Each Person receiving healthcare is typically covered by a health benefit plan, which pays for (fully or partially), or directly provides, the care. These benefit plans are provided by payers, such as health insurances or state or government agencies. In each plan the details of the health benefits are defined for the Person or her family, and the health benefit Plan might change over time typically with increasing utilization (reaching certain cost thresholds such as deductibles), plan availability and purchasing choices of the Person. The unique combinations of Payer organizations, health benefit Plans and time periods in which they are valid for a Person are recorded in this table.\n\n**User Guidance:** A Person can have multiple, overlapping, Payer_Plan_Periods in this table. For example, medical and drug coverage in the US can be represented by two Payer_Plan_Periods. The details of the benefit structure of the Plan is rarely known, the idea is just to identify that the Plans are different.
f507ccb8-cfa5-4bc6-87bd-a5652f9ec59f	0	2024-10-15 09:07:16.104856	2024-10-15 09:07:16.104856	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:condition_era	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	da236ddd-8094-487b-89b5-17e37400b5bb	e8960c13-0df7-4de1-be68-bff917ab857e	9	admin@maurodatamapper.com	\N	condition_era	**Table Description:** A Condition Era is defined as a span of time when the Person is assumed to have a given condition. Similar to Drug Eras, Condition Eras are chronological periods of Condition Occurrence. Combining individual Condition Occurrences into a single Condition Era serves two purposes:\n\n- It allows aggregation of chronic conditions that require frequent ongoing care, instead of treating each Condition Occurrence as an independent event.\n- It allows aggregation of multiple, closely timed doctor visits for the same Condition to avoid double-counting the Condition Occurrences.\nFor example, consider a Person who visits her Primary Care Physician (PCP) and who is referred to a specialist. At a later time, the Person visits the specialist, who confirms the PCP's original diagnosis and provides the appropriate treatment to resolve the condition. These two independent doctor visits should be aggregated into one Condition Era.\n\n\n\n**ETL Conventions:** Each Condition Era corresponds to one or many Condition Occurrence records that form a continuous interval.\nThe condition_concept_id field contains Concepts that are identical to those of the CONDITION_OCCURRENCE table records that make up the Condition Era. In contrast to Drug Eras, Condition Eras are not aggregated to contain Conditions of different hierarchical layers. The SQl Script for generating CONDITION_ERA records can be found [here](https://ohdsi.github.io/CommonDataModel/sqlScripts.html#condition_eras)\nThe Condition Era Start Date is the start date of the first Condition Occurrence.\nThe Condition Era End Date is the end date of the last Condition Occurrence. Condition Eras are built with a Persistence Window of 30 days, meaning, if no occurrence of the same condition_concept_id happens within 30 days of any one occurrence, it will be considered the condition_era_end_date.
7f492f15-e503-49ca-8677-f8510452a940	0	2024-10-15 09:07:16.104893	2024-10-15 09:07:16.104893	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:concept	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	9be55185-3bc6-4266-9d88-81dd6b7be8db	e8960c13-0df7-4de1-be68-bff917ab857e	4	admin@maurodatamapper.com	\N	concept	**Table Description:** The Standardized Vocabularies contains records, or Concepts, that uniquely identify each fundamental unit of meaning used to express clinical information in all domain tables of the CDM. Concepts are derived from vocabularies, which represent clinical information across a domain (e.g. conditions, drugs, procedures) through the use of codes and associated descriptions. Some Concepts are designated Standard Concepts, meaning these Concepts can be used as normative expressions of a clinical entity within the OMOP Common Data Model and within standardized analytics. Each Standard Concept belongs to one domain, which defines the location where the Concept would be expected to occur within data tables of the CDM.\n\nConcepts can represent broad categories (like 'Cardiovascular disease'), detailed clinical elements ('Myocardial infarction of the anterolateral wall') or modifying characteristics and attributes that define Concepts at various levels of detail (severity of a disease, associated morphology, etc.).\n\nRecords in the Standardized Vocabularies tables are derived from national or international vocabularies such as SNOMED-CT, RxNorm, and LOINC, or custom Concepts defined to cover various aspects of observational data analysis.
cceec998-0844-4afc-a19c-e022fc5001e4	0	2024-10-15 09:07:16.104929	2024-10-15 09:07:16.104929	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:procedure_occurrence	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	fb1aea6d-5607-4b6b-879f-191d86e99ba3	e8960c13-0df7-4de1-be68-bff917ab857e	29	admin@maurodatamapper.com	\N	procedure_occurrence	**Table Description:** This table contains records of activities or processes ordered by, or carried out by, a healthcare provider on the patient with a diagnostic or therapeutic purpose.\n\n**User Guidance:** Lab tests are not a procedure, if something is observed with an expected resulting amount and unit then it should be a measurement. Phlebotomy is a procedure but so trivial that it tends to be rarely captured. It can be assumed that there is a phlebotomy procedure associated with many lab tests, therefore it is unnecessary to add them as separate procedures. If the user finds the same procedure over concurrent days, it is assumed those records are part of a procedure lasting more than a day. This logic is in lieu of the procedure_end_date, which will be added in a future version of the CDM.\n\n**ETL Conventions:** When dealing with duplicate records, the ETL must determine whether to sum them up into one record or keep them separate. Things to consider are: - Same Procedure - Same PROCEDURE_DATETIME - Same Visit Occurrence or Visit Detail - Same Provider - Same Modifier for Procedures. Source codes and source text fields mapped to Standard Concepts of the Procedure Domain have to be recorded here.
ea797df7-8750-427f-b293-406a42a0aabb	0	2024-10-15 09:07:16.104963	2024-10-15 09:07:16.104963	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:domain	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	31db6e21-5b3b-4898-8d66-d165c8c8bc7e	e8960c13-0df7-4de1-be68-bff917ab857e	14	admin@maurodatamapper.com	\N	domain	**Table Description:** The DOMAIN table includes a list of OMOP-defined Domains the Concepts of the Standardized Vocabularies can belong to. A Domain defines the set of allowable Concepts for the standardized fields in the CDM tables. For example, the "Condition" Domain contains Concepts that describe a condition of a patient, and these Concepts can only be stored in the condition_concept_id field of the CONDITION_OCCURRENCE and CONDITION_ERA tables. This reference table is populated with a single record for each Domain and includes a descriptive name for the Domain.
91dfc225-c3bc-4b14-a381-6c2428381a41	0	2024-10-15 09:07:16.104992	2024-10-15 09:07:16.104992	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:concept_class	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	ed850f65-01b6-4c9d-8cb2-bdc2455975f0	e8960c13-0df7-4de1-be68-bff917ab857e	6	admin@maurodatamapper.com	\N	concept_class	**Table Description:** The CONCEPT_CLASS table is a reference table, which includes a list of the classifications used to differentiate Concepts within a given Vocabulary. This reference table is populated with a single record for each Concept Class.
131e95ca-026b-481a-9c83-02f93ad5a14f	0	2024-10-15 09:07:16.105036	2024-10-15 09:07:16.105036	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:source_to_concept_map	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	8c5582fd-b654-4b4c-ba73-0c73e67a6be1	e8960c13-0df7-4de1-be68-bff917ab857e	32	admin@maurodatamapper.com	\N	source_to_concept_map	**Table Description:** The source to concept map table is a legacy data structure within the OMOP Common Data Model, recommended for use in ETL processes to maintain local source codes which are not available as Concepts in the Standardized Vocabularies, and to establish mappings for each source code into a Standard Concept as target_concept_ids that can be used to populate the Common Data Model tables. The SOURCE_TO_CONCEPT_MAP table is no longer populated with content within the Standardized Vocabularies published to the OMOP community.
289afe98-fce8-4eb6-80d8-718f7c0d502b	0	2024-10-15 09:07:16.105112	2024-10-15 09:07:16.105112	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:device_exposure	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	ac9f99a0-9a0c-456e-a9ca-3d35e802b31f	e8960c13-0df7-4de1-be68-bff917ab857e	13	admin@maurodatamapper.com	\N	device_exposure	**Table Description:** The Device domain captures information about a person's exposure to a foreign physical object or instrument which is used for diagnostic or therapeutic purposes through a mechanism beyond chemical action. Devices include implantable objects (e.g. pacemakers, stents, artificial joints), medical equipment and supplies (e.g. bandages, crutches, syringes), other instruments used in medical procedures (e.g. sutures, defibrillators) and material used in clinical care (e.g. adhesives, body material, dental material, surgical material).\n\n**User Guidance:** The distinction between Devices or supplies and Procedures are sometimes blurry, but the former are physical objects while the latter are actions, often to apply a Device or supply.\n\n**ETL Conventions:** Source codes and source text fields mapped to Standard Concepts of the Device Domain have to be recorded here.
7e216658-d0ab-4960-989a-5900f84d1b36	0	2024-10-15 09:07:16.105147	2024-10-15 09:07:16.105147	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:drug_exposure	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	bf4f8187-258f-4cf4-bb51-43def7a451ed	e8960c13-0df7-4de1-be68-bff917ab857e	17	admin@maurodatamapper.com	\N	drug_exposure	**Table Description:** This table captures records about the exposure to a Drug ingested or otherwise introduced into the body. A Drug is a biochemical substance formulated in such a way that when administered to a Person it will exert a certain biochemical effect on the metabolism. Drugs include prescription and over-the-counter medicines, vaccines, and large-molecule biologic therapies. Radiological devices ingested or applied locally do not count as Drugs.\n\n**User Guidance:** The purpose of records in this table is to indicate an exposure to a certain drug as best as possible. In this context a drug is defined as an active ingredient. Drug Exposures are defined by Concepts from the Drug domain, which form a complex hierarchy. As a result, one DRUG_SOURCE_CONCEPT_ID may map to multiple standard concept ids if it is a combination product. Records in this table represent prescriptions written, prescriptions dispensed, and drugs administered by a provider to name a few. The DRUG_TYPE_CONCEPT_ID can be used to find and filter on these types. This table includes additional information about the drug products, the quantity given, and route of administration.\n\n**ETL Conventions:** Information about quantity and dose is provided in a variety of different ways and it is important for the ETL to provide as much information as possible from the data. Depending on the provenance of the data fields may be captured differently i.e. quantity for drugs administered may have a separate meaning from quantity for prescriptions dispensed. If a patient has multiple records on the same day for the same drug or procedures the ETL should not de-dupe them unless there is probable reason to believe the item is a true data duplicate. Take note on how to handle refills for prescriptions written.
98708437-6d10-4deb-8c5f-0de865c5ffcb	0	2024-10-15 09:07:16.105181	2024-10-15 09:07:16.105181	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:provider	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	31c57645-6b2d-49d1-94a5-e10925c707b1	e8960c13-0df7-4de1-be68-bff917ab857e	30	admin@maurodatamapper.com	\N	provider	**Table Description:** The PROVIDER table contains a list of uniquely identified healthcare providers. These are individuals providing hands-on healthcare to patients, such as physicians, nurses, midwives, physical therapists etc.\n\n**User Guidance:** Many sources do not make a distinction between individual and institutional providers. The PROVIDER table contains the individual providers. If the source, instead of uniquely identifying individual providers, only provides limited information such as specialty, generic or 'pooled' Provider records are listed in the PROVIDER table.
fd18381f-073c-4936-8f8a-6772af69ac14	0	2024-10-15 09:07:16.105215	2024-10-15 09:07:16.105215	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:care_site	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	ae453d5d-600d-44c3-9ce4-eb4fcb1a6fbe	e8960c13-0df7-4de1-be68-bff917ab857e	1	admin@maurodatamapper.com	\N	care_site	**Table Description:** The CARE_SITE table contains a list of uniquely identified institutional (physical or organizational) units where healthcare delivery is practiced (offices, wards, hospitals, clinics, etc.).\n\n\n\n**ETL Conventions:** Care site is a unique combination of location_id and place_of_service_source_value. Care site does not take into account the provider (human) information such a specialty. Many source data do not make a distinction between individual and institutional providers. The CARE_SITE table contains the institutional providers. If the source, instead of uniquely identifying individual Care Sites, only provides limited information such as Place of Service, generic or "pooled" Care Site records are listed in the CARE_SITE table. There can be hierarchical and business relationships between Care Sites. For example, wards can belong to clinics or departments, which can in turn belong to hospitals, which in turn can belong to hospital systems, which in turn can belong to HMOs.The relationships between Care Sites are defined in the FACT_RELATIONSHIP table.
0dcbcad1-2e3a-45d5-9bc0-f6a02e24124a	0	2024-10-15 09:07:16.105248	2024-10-15 09:07:16.105248	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:note	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	811ef1c8-d0db-47dd-b350-5992081349e7	e8960c13-0df7-4de1-be68-bff917ab857e	23	admin@maurodatamapper.com	\N	note	**Table Description:** The NOTE table captures unstructured information that was recorded by a provider about a patient in free text (in ASCII, or preferably in UTF8 format) notes on a given date. The type of note_text is CLOB or varchar(MAX) depending on RDBMS. \n\n\n\n**ETL Conventions:** HL7/LOINC CDO is a standard for consistent naming of documents to support a range of use cases: retrieval, organization, display, and exchange. It guides the creation of LOINC codes for clinical notes. CDO annotates each document with 5 dimensions:\n\n- **Kind of Document**: Characterizes the general structure of the document at a macro level (e.g. Anesthesia Consent)\n- **Type of Service**: Characterizes the kind of service or activity (e.g. evaluations, consultations, and summaries). The notion of time sequence, e.g., at the beginning (admission) at the end (discharge) is subsumed in this axis. Example: Discharge Teaching.\n- **Setting**: Setting is an extension of CMS's definitions (e.g. Inpatient, Outpatient)\n- **Subject Matter Domain (SMD)**: Characterizes the subject matter domain of a note (e.g. Anesthesiology)\n- **Role**: Characterizes the training or professional level of the author of the document, but does not break down to specialty or subspecialty (e.g. Physician)\nEach combination of these 5 dimensions rolls up to a unique LOINC code.\n\nAccording to CDO requirements, only 2 of the 5 dimensions are required to properly annotate a document; Kind of Document and any one of the other 4 dimensions.\nHowever, not all the permutations of the CDO dimensions will necessarily yield an existing LOINC code. Each of these dimensions are contained in the OMOP Vocabulary under the domain of 'Meas Value' with each dimension represented as a Concept Class.
f1eaa9dd-0c1c-4d9f-a95f-04f15711f0b4	0	2024-10-15 09:07:16.105817	2024-10-15 09:07:16.105817	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:cohort_definition	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	d56f545d-5149-4614-a651-1b6416841630	e8960c13-0df7-4de1-be68-bff917ab857e	3	admin@maurodatamapper.com	\N	cohort_definition	**Table Description:** The COHORT_DEFINITION table contains records defining a Cohort derived from the data through the associated description and syntax and upon instantiation (execution of the algorithm) placed into the COHORT table. Cohorts are a set of subjects that satisfy a given combination of inclusion criteria for a duration of time. The COHORT_DEFINITION table provides a standardized structure for maintaining the rules governing the inclusion of a subject into a cohort, and can store operational programming code to instantiate the cohort within the OMOP Common Data Model.
f618f746-d359-46a0-bd6b-f78c02176108	0	2024-10-15 09:07:16.105303	2024-10-15 09:07:16.105303	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:fact_relationship	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	fbbeb222-32fa-4c59-ab7d-a55387241eee	e8960c13-0df7-4de1-be68-bff917ab857e	19	admin@maurodatamapper.com	\N	fact_relationship	**Table Description:** The FACT_RELATIONSHIP table contains records about the relationships between facts stored as records in any table of the CDM. Relationships can be defined between facts from the same domain, or different domains. Examples of Fact Relationships include: [Person relationships](https://athena.ohdsi.org/search-terms/terms?domain=Relationship&standardConcept=Standard&page=2&pageSize=15&query=) (parent-child), care site relationships (hierarchical organizational structure of facilities within a health system), indication relationship (between drug exposures and associated conditions), usage relationships (of devices during the course of an associated procedure), or facts derived from one another (measurements derived from an associated specimen).\n\n\n\n**ETL Conventions:** All relationships are directional, and each relationship is represented twice symmetrically within the FACT_RELATIONSHIP table. For example, two persons if person_id = 1 is the mother of person_id = 2 two records are in the FACT_RELATIONSHIP table (all strings in fact concept_id records in the Concept table:\n- Person, 1, Person, 2, parent of\n- Person, 2, Person, 1, child of
e329f10b-e6d6-4124-9c4b-bf385d2e9713	0	2024-10-15 09:07:16.105372	2024-10-15 09:07:16.105372	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:concept_synonym	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	576b97c6-64e9-443a-9b51-cde06170e635	e8960c13-0df7-4de1-be68-bff917ab857e	8	admin@maurodatamapper.com	\N	concept_synonym	**Table Description:** The CONCEPT_SYNONYM table is used to store alternate names and descriptions for Concepts.
88292ca4-a1a9-4722-b930-68071f12ba3a	0	2024-10-15 09:07:16.105407	2024-10-15 09:07:16.105407	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:observation	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	f97eac9d-c12e-4bef-a482-4f105b8b6918	e8960c13-0df7-4de1-be68-bff917ab857e	25	admin@maurodatamapper.com	\N	observation	**Table Description:** The OBSERVATION table captures clinical facts about a Person obtained in the context of examination, questioning or a procedure. Any data that cannot be represented by any other domains, such as social and lifestyle facts, medical history, family history, etc. are recorded here.\n\n**User Guidance:** Observations differ from Measurements in that they do not require a standardized test or some other activity to generate clinical fact. Typical observations are medical history, family history, the stated need for certain treatment, social circumstances, lifestyle choices, healthcare utilization patterns, etc. If the generation clinical facts requires a standardized testing such as lab testing or imaging and leads to a standardized result, the data item is recorded in the MEASUREMENT table. If the clinical fact observed determines a sign, symptom, diagnosis of a disease or other medical condition, it is recorded in the CONDITION_OCCURRENCE table. Valid Observation Concepts are not enforced to be from any domain though they still should be Standard Concepts.\n\n**ETL Conventions:** Records whose Source Values map to any domain besides Condition, Procedure, Drug, Measurement or Device should be stored in the Observation table. Observations can be stored as attribute value pairs, with the attribute as the Observation Concept and the value representing the clinical fact. This fact can be a Concept (stored in VALUE_AS_CONCEPT), a numerical value (VALUE_AS_NUMBER), a verbatim string (VALUE_AS_STRING), or a datetime (VALUE_AS_DATETIME). Even though Observations do not have an explicit result, the clinical fact can be stated separately from the type of Observation in the VALUE_AS_* fields. It is recommended for Observations that are suggestive statements of positive assertion should have a value of 'Yes' (concept_id=4188539), recorded, even though the null value is the equivalent.
a86c9283-dd92-4c1b-93bd-a56cc7f010cd	0	2024-10-15 09:07:16.105446	2024-10-15 09:07:16.105446	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:observation_period	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	a45fb14e-1a96-480b-930d-6177f2cd0317	e8960c13-0df7-4de1-be68-bff917ab857e	26	admin@maurodatamapper.com	\N	observation_period	**Table Description:** This table contains records which define spans of time during which two conditions are expected to hold: (i) Clinical Events that happened to the Person are recorded in the Event tables, and (ii) absense of records indicate such Events did not occur during this span of time.\n\n**User Guidance:** For each Person, one or more OBSERVATION_PERIOD records may be present, but they will not overlap or be back to back to each other. Events may exist outside all of the time spans of the OBSERVATION_PERIOD records for a patient, however, absence of an Event outside these time spans cannot be construed as evidence of absence of an Event. Incidence or prevalence rates should only be calculated for the time of active OBSERVATION_PERIOD records. When constructing cohorts, outside Events can be used for inclusion criteria definition, but without any guarantee for the performance of these criteria. Also, OBSERVATION_PERIOD records can be as short as a single day, greatly disturbing the denominator of any rate calculation as part of cohort characterizations. To avoid that, apply minimal observation time as a requirement for any cohort definition.\n\n**ETL Conventions:** Each Person needs to have at least one OBSERVATION_PERIOD record, which should represent time intervals with a high capture rate of Clinical Events. Some source data have very similar concepts, such as enrollment periods in insurance claims data. In other source data such as most EHR systems these time spans need to be inferred under a set of assumptions. It is the discretion of the ETL developer to define these assumptions. In many ETL solutions the start date of the first occurrence or the first high quality occurrence of a Clinical Event (Condition, Drug, Procedure, Device, Measurement, Visit) is defined as the start of the OBSERVATION_PERIOD record, and the end date of the last occurrence of last high quality occurrence of a Clinical Event, or the end of the database period becomes the end of the OBSERVATOIN_PERIOD for each Person. If a Person only has a single Clinical Event the OBSERVATION_PERIOD record can be as short as one day. Depending on these definitions it is possible that Clinical Events fall outside the time spans defined by OBSERVATION_PERIOD records. Family history or history of Clinical Events generally are not used to generate OBSERVATION_PERIOD records around the time they are referring to. Any two overlapping or adjacent OBSERVATION_PERIOD records have to be merged into one.
0a0f9889-f61f-4536-93ad-10cc9961386e	0	2024-10-15 09:07:16.106045	2024-10-15 09:07:16.106045	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:location	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	a74a5870-7140-40c8-a0d0-13686010df8e	e8960c13-0df7-4de1-be68-bff917ab857e	20	admin@maurodatamapper.com	\N	location	**Table Description:** The LOCATION table represents a generic way to capture physical location or address information of Persons and Care Sites.\n\n**User Guidance:** The current iteration of the LOCATION table is US centric. Until a major release to correct this, certain fields can be used to represent different international values. <br><br> - STATE can also be used for province or district<br>- ZIP is also the postal code or postcode <br>- COUNTY can also be used to represent region\n\n**ETL Conventions:** Each address or Location is unique and is present only once in the table. Locations do not contain names, such as the name of a hospital. In order to construct a full address that can be used in the postal service, the address information from the Location needs to be combined with information from the Care Site.
6cf99cd5-4dee-4f6c-8fa8-9af9ecd75565	0	2024-10-15 09:07:16.105481	2024-10-15 09:07:16.105481	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:condition_occurrence	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	373ad127-a380-4607-9a8a-98bdb9fa4af8	e8960c13-0df7-4de1-be68-bff917ab857e	10	admin@maurodatamapper.com	\N	condition_occurrence	**Table Description:** This table contains records of Events of a Person suggesting the presence of a disease or medical condition stated as a diagnosis, a sign, or a symptom, which is either observed by a Provider or reported by the patient. \n\n**User Guidance:** Conditions are defined by Concepts from the Condition domain, which form a complex hierarchy. As a result, the same Person with the same disease may have multiple Condition records, which belong to the same hierarchical family. Most Condition records are mapped from diagnostic codes, but recorded signs, symptoms and summary descriptions also contribute to this table. Rule out diagnoses should not be recorded in this table, but in reality their negating nature is not always captured in the source data, and other precautions must be taken when when identifying Persons who should suffer from the recorded Condition. Record all conditions as they exist in the source data. Any decisions about diagnosis/phenotype definitions would be done through cohort specifications. These cohorts can be housed in the [COHORT](https://ohdsi.github.io/CommonDataModel/cdm531.html#payer_plan_period) table. Conditions span a time interval from start to end, but are typically recorded as single snapshot records with no end date. The reason is twofold: (i) At the time of the recording the duration is not known and later not recorded, and (ii) the Persons typically cease interacting with the healthcare system when they feel better, which leads to incomplete capture of resolved Conditions. The [CONDITION_ERA](https://ohdsi.github.io/CommonDataModel/cdm531.html#condition_era) table addresses this issue. Family history and past diagnoses ('history of') are not recorded in this table. Instead, they are listed in the [OBSERVATION](https://ohdsi.github.io/CommonDataModel/cdm531.html#observation) table. Codes written in the process of establishing the diagnosis, such as 'question of' of and 'rule out', should not represented here. Instead, they should be recorded in the [OBSERVATION](https://ohdsi.github.io/CommonDataModel/cdm531.html#observation) table, if they are used for analyses. However, this information is not always available.\n\n**ETL Conventions:** Source codes and source text fields mapped to Standard Concepts of the Condition Domain have to be recorded here.
db0dd609-88b3-43f4-977b-def10bb5237f	0	2024-10-15 09:07:16.105854	2024-10-15 09:07:16.105854	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:person	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	2640a117-336a-427c-b2ff-6d1f07c297a3	e8960c13-0df7-4de1-be68-bff917ab857e	28	admin@maurodatamapper.com	\N	person	**Table Description:** This table serves as the central identity management for all Persons in the database. It contains records that uniquely identify each person or patient, and some demographic information. \n\n**User Guidance:** All records in this table are independent Persons.\n\n**ETL Conventions:** All Persons in a database needs one record in this table, unless they fail data quality requirements specified in the ETL. Persons with no Events should have a record nonetheless. If more than one data source contributes Events to the database, Persons must be reconciled, if possible, across the sources to create one single record per Person. The content of the BIRTH_DATETIME must be equivalent to the content of BIRTH_DAY, BIRTH_MONTH and BIRTH_YEAR.
5806b518-e8c7-44d2-a601-324ed94d9336	0	2024-10-15 09:07:16.105893	2024-10-15 09:07:16.105893	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:visit_occurrence	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	87b95a77-c94b-4b50-a1f9-545c2a5e2d50	e8960c13-0df7-4de1-be68-bff917ab857e	35	admin@maurodatamapper.com	\N	visit_occurrence	**Table Description:** This table contains Events where Persons engage with the healthcare system for a duration of time. They are often also called "Encounters". Visits are defined by a configuration of circumstances under which they occur, such as (i) whether the patient comes to a healthcare institution, the other way around, or the interaction is remote, (ii) whether and what kind of trained medical staff is delivering the service during the Visit, and (iii) whether the Visit is transient or for a longer period involving a stay in bed. \n\n**User Guidance:** The configuration defining the Visit are described by Concepts in the Visit Domain, which form a hierarchical structure, but rolling up to generally familiar Visits adopted in most healthcare systems worldwide:\n\n- [Inpatient Visit](https://athena.ohdsi.org/search-terms/terms/9201): Person visiting hospital, at a Care Site, in bed, for duration of more than one day, with physicians and other Providers permanently available to deliver service around the clock \n- [Emergency Room Visit](https://athena.ohdsi.org/search-terms/terms/9203): Person visiting dedicated healthcare institution for treating emergencies, at a Care Site, within one day, with physicians and Providers permanently available to deliver service around the clock\n- [Emergency Room and Inpatient Visit](https://athena.ohdsi.org/search-terms/terms/262): Person visiting ER followed by a subsequent Inpatient Visit, where Emergency department is part of hospital, and transition from the ER to other hospital departments is undefined\n- [Non-hospital institution Visit](https://athena.ohdsi.org/search-terms/terms/42898160): Person visiting dedicated institution for reasons of poor health, at a Care Site, long-term or permanently, with no physician but possibly other Providers permanently available to deliver service around the clock\n- [Outpatient Visit](https://athena.ohdsi.org/search-terms/terms/9202): Person visiting dedicated ambulatory healthcare institution, at a Care Site, within one day, without bed, with physicians or medical Providers delivering service during Visit\n- [Home Visit](https://athena.ohdsi.org/search-terms/terms/581476): Provider visiting Person, without a Care Site, within one day, delivering service\n- [Telehealth Visit](https://athena.ohdsi.org/search-terms/terms/5083): Patient engages with Provider through communication media\n- [Pharmacy Visit](https://athena.ohdsi.org/search-terms/terms/581458): Person visiting pharmacy for dispensing of Drug, at a Care Site, within one day\n- [Laboratory Visit](https://athena.ohdsi.org/search-terms/terms/32036): Patient visiting dedicated institution, at a Care Site, within one day, for the purpose of a Measurement.\n- [Ambulance Visit](https://athena.ohdsi.org/search-terms/terms/581478): Person using transportation service for the purpose of initiating one of the other Visits, without a Care Site, within one day, potentially with Providers accompanying the Visit and delivering service\n- [Case Management Visit](https://athena.ohdsi.org/search-terms/terms/38004193): Person interacting with healthcare system, without a Care Site, within a day, with no Providers involved, for administrative purposes\n\nThe Visit duration, or 'length of stay', is defined as VISIT_END_DATE - VISIT_START_DATE. For all Visits this is <1 day, except Inpatient Visits and Non-hospital institution Visits. The CDM also contains the VISIT_DETAIL table where additional information about the Visit is stored, for example, transfers between units during an inpatient Visit.\n\n**ETL Conventions:** Visits can be derived easily if the source data contain coding systems for Place of Service or Procedures, like CPT codes for well visits. In those cases, the codes can be looked up and mapped to a Standard Visit Concept. Otherwise, Visit Concepts have to be identified in the ETL process. This table will contain concepts in the Visit domain. These concepts are arranged in a hierarchical structure to facilitate cohort definitions by rolling up to generally familiar Visits adopted in most healthcare systems worldwide. Visits can be adjacent to each other, i.e. the end date of one can be identical with the start date of the other. As a consequence, more than one-day Visits or their descendants can be recorded for the same day. Multi-day visits must not overlap, i.e. share days other than start and end days. It is often the case that some logic should be written for how to define visits and how to assign Visit_Concept_Id. For example, in US claims outpatient visits that appear to occur within the time period of an inpatient visit can be rolled into one with the same Visit_Occurrence_Id. In EHR data inpatient visits that are within one day of each other may be strung together to create one visit. It will all depend on the source data and how encounter records should be translated to visit occurrences. Providers can be associated with a Visit through the PROVIDER_ID field, or indirectly through PROCEDURE_OCCURRENCE records linked both to the VISIT and PROVIDER tables.
a1a7f294-696a-417c-b974-28785ebd5d87	0	2024-10-15 09:07:16.105932	2024-10-15 09:07:16.105932	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:dose_era	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	03a792ee-95bf-478c-9336-181eb590e263	e8960c13-0df7-4de1-be68-bff917ab857e	15	admin@maurodatamapper.com	\N	dose_era	**Table Description:** A Dose Era is defined as a span of time when the Person is assumed to be exposed to a constant dose of a specific active ingredient.\n\n\n\n**ETL Conventions:** Dose Eras will be derived from records in the DRUG_EXPOSURE table and the Dose information from the DRUG_STRENGTH table using a standardized algorithm. Dose Form information is not taken into account. So, if the patient changes between different formulations, or different manufacturers with the same formulation, the Dose Era is still spanning the entire time of exposure to the Ingredient.
af960566-6b46-4ec6-81e4-ad310b5ce048	0	2024-10-15 09:07:16.105969	2024-10-15 09:07:16.105969	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:measurement	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	0296aa88-8d05-4213-9ffe-61ed2c1d7ba1	e8960c13-0df7-4de1-be68-bff917ab857e	21	admin@maurodatamapper.com	\N	measurement	**Table Description:** The MEASUREMENT table contains records of Measurements, i.e. structured values (numerical or categorical) obtained through systematic and standardized examination or testing of a Person or Person's sample. The MEASUREMENT table contains both orders and results of such Measurements as laboratory tests, vital signs, quantitative findings from pathology reports, etc. Measurements are stored as attribute value pairs, with the attribute as the Measurement Concept and the value representing the result. The value can be a Concept (stored in VALUE_AS_CONCEPT), or a numerical value (VALUE_AS_NUMBER) with a Unit (UNIT_CONCEPT_ID). The Procedure for obtaining the sample is housed in the PROCEDURE_OCCURRENCE table, though it is unnecessary to create a PROCEDURE_OCCURRENCE record for each measurement if one does not exist in the source data. Measurements differ from Observations in that they require a standardized test or some other activity to generate a quantitative or qualitative result. If there is no result, it is assumed that the lab test was conducted but the result was not captured.\n\n**User Guidance:** Measurements are predominately lab tests with a few exceptions, like blood pressure or function tests. Results are given in the form of a value and unit combination. When investigating measurements, look for operator_concept_ids (<, >, etc.).\n\n**ETL Conventions:** Only records where the source value maps to a Concept in the measurement domain should be included in this table. Even though each Measurement always has a result, the fields VALUE_AS_NUMBER and VALUE_AS_CONCEPT_ID are not mandatory as often the result is not given in the source data. When the result is not known, the Measurement record represents just the fact that the corresponding Measurement was carried out, which in itself is already useful information for some use cases. For some Measurement Concepts, the result is included in the test. For example, ICD10 CONCEPT_ID [45548980](https://athena.ohdsi.org/search-terms/terms/45548980) 'Abnormal level of unspecified serum enzyme' indicates a Measurement and the result (abnormal). In those situations, the CONCEPT_RELATIONSHIP table in addition to the 'Maps to' record contains a second record with the relationship_id set to 'Maps to value'. In this example, the 'Maps to' relationship directs to [4046263](https://athena.ohdsi.org/search-terms/terms/4046263) 'Enzyme measurement' as well as a 'Maps to value' record to [4135493](https://athena.ohdsi.org/search-terms/terms/4135493) 'Abnormal'.
6b2be402-a03c-40ca-b2d8-3f3aaf85bfd2	0	2024-10-15 09:07:16.106005	2024-10-15 09:07:16.106005	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:note_nlp	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	4f604a76-87fd-4bcb-bcb1-3d5ca3d29af9	e8960c13-0df7-4de1-be68-bff917ab857e	24	admin@maurodatamapper.com	\N	note_nlp	**Table Description:** The NOTE_NLP table encodes all output of NLP on clinical notes. Each row represents a single extracted term from a note.
a6d4fbe5-014f-4327-8a06-a7a192bd4b3a	0	2024-10-15 09:07:16.106081	2024-10-15 09:07:16.106081	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:concept_ancestor	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	78c3d476-33ec-4b6c-bb69-3405977ac3f0	e8960c13-0df7-4de1-be68-bff917ab857e	5	admin@maurodatamapper.com	\N	concept_ancestor	**Table Description:** The CONCEPT_ANCESTOR table is designed to simplify observational analysis by providing the complete hierarchical relationships between Concepts. Only direct parent-child relationships between Concepts are stored in the CONCEPT_RELATIONSHIP table. To determine higher level ancestry connections, all individual direct relationships would have to be navigated at analysis time. The CONCEPT_ANCESTOR table includes records for all parent-child relationships, as well as grandparent-grandchild relationships and those of any other level of lineage. Using the CONCEPT_ANCESTOR table allows for querying for all descendants of a hierarchical concept. For example, drug ingredients and drug products are all descendants of a drug class ancestor.\n\nThis table is entirely derived from the CONCEPT, CONCEPT_RELATIONSHIP and RELATIONSHIP tables.
6bd03b60-41e4-4af9-8a8d-bdfd65a09ac2	0	2024-10-15 09:07:16.10611	2024-10-15 09:07:16.10611	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:drug_era	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	93746990-08af-4543-8efe-95e424af8425	e8960c13-0df7-4de1-be68-bff917ab857e	16	admin@maurodatamapper.com	\N	drug_era	**Table Description:** A Drug Era is defined as a span of time when the Person is assumed to be exposed to a particular active ingredient. A Drug Era is not the same as a Drug Exposure: Exposures are individual records corresponding to the source when Drug was delivered to the Person, while successive periods of Drug Exposures are combined under certain rules to produce continuous Drug Eras.\n\n\n\n**ETL Conventions:** The SQL script for generating DRUG_ERA records can be found [here](https://ohdsi.github.io/CommonDataModel/sqlScripts.html#drug_eras).
ab48a76e-a401-4780-942a-8d189b4a56a9	0	2024-10-15 09:07:16.106146	2024-10-15 09:07:16.106146	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:drug_strength	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	14cd18b3-9286-46cd-9d94-da874477ff48	e8960c13-0df7-4de1-be68-bff917ab857e	18	admin@maurodatamapper.com	\N	drug_strength	**Table Description:** The DRUG_STRENGTH table contains structured content about the amount or concentration and associated units of a specific ingredient contained within a particular drug product. This table is supplemental information to support standardized analysis of drug utilization.
2c9cc702-a79e-46ee-a9ad-af0a40c44d8c	0	2024-10-15 09:07:16.106182	2024-10-15 09:07:16.106182	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:visit_detail	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	c47a860f-0c1f-4f61-a02b-bc2a05b73994	e8960c13-0df7-4de1-be68-bff917ab857e	34	admin@maurodatamapper.com	\N	visit_detail	**Table Description:** The VISIT_DETAIL table is an optional table used to represents details of each record in the parent VISIT_OCCURRENCE table. A good example of this would be the movement between units in a hospital during an inpatient stay or claim lines associated with a one insurance claim. For every record in the VISIT_OCCURRENCE table there may be 0 or more records in the VISIT_DETAIL table with a 1:n relationship where n may be 0. The VISIT_DETAIL table is structurally very similar to VISIT_OCCURRENCE table and belongs to the visit domain.\n\n**User Guidance:** The configuration defining the Visit Detail is described by Concepts in the Visit Domain, which form a hierarchical structure. The Visit Detail record will have an associated to the Visit Occurrence record in two ways: <br> 1. The Visit Detail record will have the VISIT_OCCURRENCE_ID it is associated to 2. The VISIT_DETAIL_CONCEPT_ID  will be a descendant of the VISIT_CONCEPT_ID for the Visit.\n\n**ETL Conventions:** It is not mandatory that the VISIT_DETAIL table be filled in, but if you find that the logic to create VISIT_OCCURRENCE records includes the roll-up of multiple smaller records to create one picture of a Visit then it is a good idea to use VISIT_DETAIL. In EHR data, for example, a Person may be in the hospital but instead of one over-arching Visit their encounters are recorded as times they interacted with a health care provider. A Person in the hospital interacts with multiple providers multiple times a day so the encounters must be strung together using some heuristic (defined by the ETL) to identify the entire Visit. In this case the encounters would be considered Visit Details and the entire Visit would be the Visit Occurrence. In this example it is also possible to use the Vocabulary to distinguish Visit Details from a Visit Occurrence by setting the VISIT_CONCEPT_ID to [9201](https://athena.ohdsi.org/search-terms/terms/9201) and the VISIT_DETAIL_CONCEPT_IDs either to 9201 or its children to indicate where the patient was in the hospital at the time of care.
ac362893-2b54-45e2-90d5-4a3346aac4d7	0	2024-10-15 09:07:16.106235	2024-10-15 09:07:16.106235	dm:OMOP Synthetic Data$1.0.0|dc:OMOP|dc:cost	1	1	385c31f8-5327-4854-8fdd-caa2ecc162bc	2af485db-3665-4c90-a4cc-7feb40cca42a	e8960c13-0df7-4de1-be68-bff917ab857e	11	admin@maurodatamapper.com	\N	cost	**Table Description:** The COST table captures records containing the cost of any medical event recorded in one of the OMOP clinical event tables such as DRUG_EXPOSURE, PROCEDURE_OCCURRENCE, VISIT_OCCURRENCE, VISIT_DETAIL, DEVICE_OCCURRENCE, OBSERVATION or MEASUREMENT.\n\nEach record in the cost table account for the amount of money transacted for the clinical event. So, the COST table may be used to represent both receivables (charges) and payments (paid), each transaction type represented by its COST_CONCEPT_ID. The COST_TYPE_CONCEPT_ID field will use concepts in the Standardized Vocabularies to designate the source (provenance) of the cost data. A reference to the health plan information in the PAYER_PLAN_PERIOD table is stored in the record for information used for the adjudication system to determine the persons benefit for the clinical event.\n\n**User Guidance:** When dealing with summary costs, the cost of the goods or services the provider provides is often not known directly, but derived from the hospital charges multiplied by an average cost-to-charge ratio.\n\n**ETL Conventions:** One cost record is generated for each response by a payer. In a claims databases, the payment and payment terms reported by the payer for the goods or services billed will generate one cost record. If the source data has payment information for more than one payer (i.e. primary insurance and secondary insurance payment for one entity), then a cost record is created for each reporting payer. Therefore, it is possible for one procedure to have multiple cost records for each payer, but typically it contains one or no record per entity. Payer reimbursement cost records will be identified by using the PAYER_PLAN_ID field. Drug costs are composed of ingredient cost (the amount charged by the wholesale distributor or manufacturer), the dispensing fee (the amount charged by the pharmacy and the sales tax).
